import React, { useState, useEffect } from 'react';
import styled, { keyframes } from 'styled-components';
import { motion, AnimatePresence } from 'framer-motion';
import Confetti from 'react-confetti';

const CelebrationOverlay = styled(motion.div)`
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: linear-gradient(45deg, #ff6b6b, #4ecdc4, #45b7d1, #96ceb4, #ffeaa7);
  background-size: 400% 400%;
  animation: gradientShift 4s ease infinite;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  z-index: 1000;

  @keyframes gradientShift {
    0% { background-position: 0% 50%; }
    50% { background-position: 100% 50%; }
    100% { background-position: 0% 50%; }
  }
`;

const CelebrationText = styled(motion.h1)`
  font-family: 'Dancing Script', cursive;
  font-size: clamp(3rem, 12vw, 7rem);
  font-weight: 700;
  color: white;
  text-align: center;
  margin-bottom: 1rem;
  text-shadow: 3px 3px 6px rgba(0,0,0,0.3);
`;

const CelebrationSubtext = styled(motion.p)`
  font-size: clamp(1.2rem, 5vw, 2.5rem);
  color: white;
  text-align: center;
  max-width: 700px;
  padding: 0 20px;
  text-shadow: 2px 2px 4px rgba(0,0,0,0.3);
  font-weight: 600;
  margin-bottom: 2rem;
`;

const CloseButton = styled(motion.button)`
  background: rgba(255, 255, 255, 0.2);
  color: white;
  border: 2px solid white;
  padding: 15px 30px;
  border-radius: 25px;
  font-size: 1.1rem;
  cursor: pointer;
  backdrop-filter: blur(10px);
  font-weight: 600;

  &:hover {
    background: rgba(255, 255, 255, 0.3);
    transform: translateY(-2px);
  }
`;

const Firework = styled(motion.div)`
  position: absolute;
  width: 6px;
  height: 6px;
  background: ${props => props.color};
  border-radius: 50%;

  &::before {
    content: '';
    position: absolute;
    top: -25px;
    left: -25px;
    width: 50px;
    height: 50px;
    border: 3px solid ${props => props.color};
    border-radius: 50%;
    opacity: 0;
    animation: explode 1.5s ease-out forwards;
  }

  &::after {
    content: '';
    position: absolute;
    top: -15px;
    left: -15px;
    width: 30px;
    height: 30px;
    background: radial-gradient(circle, ${props => props.color} 0%, transparent 70%);
    border-radius: 50%;
    opacity: 0;
    animation: explode 2s ease-out forwards;
  }

  @keyframes explode {
    0% { transform: scale(0); opacity: 1; }
    50% { transform: scale(1); opacity: 0.8; }
    100% { transform: scale(2); opacity: 0; }
  }
`;

function NewYearCelebration({ onClose }) {
  const [fireworks, setFireworks] = useState([]);

  useEffect(() => {
    // Create fireworks
    const newFireworks = Array.from({ length: 25 }, (_, i) => ({
      id: i,
      x: Math.random() * window.innerWidth,
      y: Math.random() * window.innerHeight,
      color: ['#ff6b6b', '#4ecdc4', '#45b7d1', '#96ceb4', '#ffeaa7', '#dda0dd'][Math.floor(Math.random() * 6)],
      delay: Math.random() * 3
    }));
    setFireworks(newFireworks);

    // Create new fireworks every 2 seconds
    const interval = setInterval(() => {
      const moreFireworks = Array.from({ length: 10 }, (_, i) => ({
        id: Date.now() + i,
        x: Math.random() * window.innerWidth,
        y: Math.random() * window.innerHeight,
        color: ['#ff6b6b', '#4ecdc4', '#45b7d1', '#96ceb4', '#ffeaa7', '#dda0dd'][Math.floor(Math.random() * 6)],
        delay: 0
      }));
      setFireworks(prev => [...prev.slice(-15), ...moreFireworks]);
    }, 2000);

    return () => clearInterval(interval);
  }, []);

  return (
    <AnimatePresence>
      <CelebrationOverlay
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        exit={{ opacity: 0 }}
        transition={{ duration: 1 }}
      >
        <Confetti 
          width={window.innerWidth}
          height={window.innerHeight}
          numberOfPieces={300}
          recycle={true}
          gravity={0.3}
        />

        {fireworks.map(firework => (
          <Firework
            key={firework.id}
            color={firework.color}
            style={{ left: firework.x, top: firework.y }}
            initial={{ scale: 0, opacity: 0 }}
            animate={{ scale: 1, opacity: 1 }}
            transition={{ delay: firework.delay, duration: 0.5 }}
          />
        ))}

        <CelebrationText
          initial={{ scale: 0, opacity: 0 }}
          animate={{ scale: 1, opacity: 1 }}
          transition={{ delay: 1, duration: 1.5, type: "spring", stiffness: 100 }}
        >
          ðŸŽ‰ Happy New Year 2025! ðŸŽ‰
        </CelebrationText>

        <CelebrationSubtext
          initial={{ y: 100, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ delay: 2.5, duration: 1 }}
        >
          Welcome to 2025, beautiful Aiman! âœ¨
        </CelebrationSubtext>

        <CloseButton
          initial={{ y: 50, opacity: 0 }}
          animate={{ y: 0, opacity: 1 }}
          transition={{ delay: 3.5, duration: 1 }}
          onClick={onClose}
          whileHover={{ scale: 1.05 }}
          whileTap={{ scale: 0.95 }}
        >
          Continue to Birthday Mode ðŸ’–
        </CloseButton>
      </CelebrationOverlay>
    </AnimatePresence>
  );
}

export default NewYearCelebration;
